def get_cos_similar(v1, v2):
    num = np.dot(v1, v2)  # 向量点乘
    denom = np.linalg.norm(v1) * np.linalg.norm(v2)  # 求模长的乘积
    return 0.5 + 0.5 * (num / denom) if denom != 0 else 0


def words_similar_to(word):
    with open('data/TAP/entities.dict') as fin:
        entity2id = dict()
        for line in fin:
            eid, entity = line.strip().split('\t\t')
            entity2id[int(eid)] = entity
            if entity == word:
                index = int(eid)

    entity_embedding = np.load('models/RotatE_TAP_0/entity_embedding.npy')
    # relation_embedding = np.load('models/RotatE_TAP_0/relation_embedding.npy')

    word_embedding = entity_embedding[index]

    score = []
    for embedding in entity_embedding:
        score.append(get_cos_similar(word_embedding, embedding))

    topk = heapq.nlargest(5, range(len(score)), score.__getitem__)

    words_similar = []
    for k in topk:
        print(k)
        words_similar.append(entity2id[k])

    return words_similar


